function hashCode(s: string) {
  let h = 0
  let i = 0
  const l = s.length
  if (l > 0) while (i < l) h = ((h << 5) - h + s.charCodeAt(i++)) | 0
  return h
}

export function getColor(key: string) {
  if (colorMap[key]) return '#' + colorMap[key]
  const hash = hashCode(key)
  const colorScheme = [
    // some colors that have nice contrast in both light and dark mode
    '#ee0000',
    '#aa6600',
    '#008800',
    '#777744',
    '#cc4455',
    '#777766',
    '#bb5566',
    '#dd2277',
    '#667788',
    '#8866aa',
    '#aa55aa',
    '#667799',
    '#7766cc',
    '#0077cc',
    '#7755ff',
    '#cc00dd',
    '#9B5FC0',
    '#BE03FD',
    '#5170D7',
    '#826D8C',
    '#B16002',
    '#6F7C00',
    '#8F7303',
    '#866F85',
    '#507B9C',
    '#C45508',
    '#3778BF',
  ]
  return colorScheme[Math.abs(hash) % colorScheme.length]
}

export interface Block {
  block: string
  count: number
  pos: number
  color: string
}

export const overworldBlockMap = generateBlockMap(overworldRaw, -64)
export const netherBlockMap = generateBlockMap(netherRaw, 0)
export const endBlockMap = generateBlockMap(endRaw, 0)

function generateBlockMap(data: Record<string, number[]>, offset: number) {
  const blockMap: Block[] = []
  const totalBlocks: number[] = new Array(320).fill(0)
  for (const key in data) {
    for (const [index, count] of data[key].entries()) {
      totalBlocks[index] += count
    }
  }
  console.log(totalBlocks)
  for (const key in data) {
    for (const [index, count] of data[key].entries()) {
      blockMap.push({
        block: key,
        // number of X found in 100,000 blocks
        count: count,
        pos: index + offset,
        color: getColor(key),
      })
    }
  }

  return blockMap
}
